		e.preventDefault();
		this.props.authStore.login().then(() => this.props.history.replace('/'));
	}

	handleUsernameChange = (e) => {
		this.props.authStore.setUsername(e.target.value);
	}

	handlePasswordChange = (e) => {
		this.props.authStore.setPassword(e.target.value);
	}

